import React from 'react';
import {StyleSheet, css} from 'aphrodite';
import Text from "../../helpers/Text";
const HelloAndImage = () => {
    const style = StyleSheet.create({
        containerRow: {
            'display':"flex",
            flexDirection: "row"
        },
    })
    return (
        <div className={css(style.containerRow)}>
            <div style={{
                flex: 30
            }}>
                <Text text="Улучшайте или создавайте ваш бизнес с IT B&SH"></Text>
                <br/>
                <Text text="Мы современная IT компания которая поможет вам начать свой путь в техническом мире"></Text>
                <p>button will be</p>
            </div>
            <div style={{
                flex: "10"
            }}>
                <img style={{
                    "width" : "100%"
                }} src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Image_created_with_a_mobile_phone.png/1200px-Image_created_with_a_mobile_phone.png"/>
            </div>

        </div>
    );
};

export default HelloAndImage;
